import React from 'react';
import { Link } from 'react-router-dom';
import './Sidebar.css';

function Sidebar() {
  return (
    <div className="Sidebar">
      <nav>
        <ul>
          <li>
            <Link to="/">Overview</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default Sidebar;
